description:
Under Ten Flags is a fact-based British maritime epic set during World War II. Allied ships are being victimized by a German surface raider, which sails under friendly flags until moving in for the kill. Since so many nationalities were involved in making this film (both before and behind the cameras), it is difficult at times to determine whose side one is supposed to be on. On screen, the Germans seem the cleverest and most resourceful of all the combatants; at times, one hopes that they'll get away with their high-seas perfidy--especially since the captain is played by charismatic American actor Van Heflin. Under Ten Flags has a minimum of war action, but this didn't prevent an enterprising home-movie firm from excerpting nine minutes' worth of highlights for an 8-millimeter version--which did better business than the original 92 minute feature!
